import React, {Component} from  'react'

export default class TaskStatus extends Component {
    constructor(props) {
        super(props);
    }
    state = {
        done: false
    }
    onClickSpanHandler = () =>{
        console.log(this.props.test)
    }
    render() {
       const {done} = this.state;



    const {className, test} = this.props


        if(className ==='description'){
            if(test === 'completed'){
                if(done){
                    const className = 'editing'
                }
                return <span onClick={this.onClickSpanHandler} onClickSpanHandler className={className}>Completed task</span>
            }
            else  if(test === 'editing'){
                return <span  onClick={this.onClickSpanHandler} className={className}>Editing task</span>
            }
            return <span  onClick={this.onClickSpanHandler} className={className}>Active task</span>
        }

        else if(className === 'created') {
            return  <span className={className}>  created ____ ago</span>
        }

    }

}

